import { useEffect, useState } from "react";

function App() {
  // 1. 没有依赖项 初始渲染 + 组件更新时执行
  const [count, setCount] = useState(0);
  useEffect(() => {
    console.log("没有依赖项");
    console.log(count);
  });
  setTimeout(() => {
    setCount(count++);
  }, 500);
  return <div className="App"></div>;
}

export default App;
